import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

const Home = () => {
	const [userDetails, setUserDetails] = useState();
	const navigate = useNavigate();
	const logout = () => {
		setUserDetails(null);
		navigate("/login");
	};
	return (
		<div>
			<button onClick={logout}>Logout</button>
		</div>
	);
};

export default Home;
